- model: service_interaction.event
  pk: 1
  fields:
    name: Как получить субсидии на возмещение затрат на уплату процентов по кредитам и лизинговым платежам?
    event_datetime: 2024-06-20 10:00:00
    description: Ответим на вопросы \n
      1) Что такое производственное оборудование (детализация критериев)? \n
      3) Каким документом подтверждается производство оборудования на территории Российской Федерации? \n
      4) Важны ли даты заключения кредитных договоров на момент подачи заявки на предоставление субсидии? \n
      5)Какой максимальный период с даты заключения кредитных договоров до даты подачи заявки?
    event_type: webinar
    created_at: 2024-01-01 10:00:00
    updated_at: 2024-01-01 10:00:00
