- model: service_interaction.event
  pk: 3
  fields:
    name: День открытых дверей для инвесторов в технолисе "Москва"
    event_datetime: 2024-06-30 10:00:00
    description: 6 площадок внутри Москвы и Зеленограда \n
      -Производственная и технико-внедренческая деятельность \n
      -ПРЕИМУЩЕСТВА\n
      -Приоритетная поддержка от города (субсидии, льготные займы и т.д.) \n
      -Земельные участки (greenfield) и готовые помещения в аренду \n
      -Бесплатное подключение к инженерным сетям \n
      -Льготные условия выкупа земельного участка \n
      -Собственный таможенный пост
